import * as C from './styles';

type Props = {
  title: string;
  value: number;
}

export const ResumeItem = ({ title, value }: Props) => {
  return (
    <C.Container>
      <C.Title>{title}</C.Title>
      <C.Info color={value < 0 ? 'red' : 'green'}>R$ {value}</C.Info>
    </C.Container>
  );
}
